function SortList(v1, v2) {
    var a = v1.name;
    var b = v2.name;
    var reg = /[0-9]+/g;
    var lista = a.match(reg);
    var listb = b.match(reg);
    if (!lista || !listb) {
        return a.localeCompare(b);
    }
    for (var i = 0, minLen = Math.min(lista.length, listb.length); i < minLen; i++) {
        //数字所在位置序号
        var indexa = a.indexOf(lista[i]);
        var indexb = b.indexOf(listb[i]);
        //数字前面的前缀
        var prefixa = a.substring(0, indexa);
        var prefixb = a.substring(0, indexb);
        //数字的string
        var stra = lista[i];
        var strb = listb[i];
        //数字的值
        var numa = parseInt(stra);
        var numb = parseInt(strb);
        //如果数字的序号不等或前缀不等，属于前缀不同的情况，直接比较
        if (indexa != indexb || prefixa != prefixb) {
            return a.localeCompare(b);
        }
        else {
            //数字的string全等
            if (stra === strb) {
                //如果是最后一个数字，比较数字的后缀
                if (i == minLen - 1) {
                    return a.substring(indexa).localeCompare(b.substring(indexb));
                }
                //如果不是最后一个数字，则循环跳转到下一个数字，并去掉前面相同的部分
                else {
                    a = a.substring(indexa + stra.length);
                    b = b.substring(indexa + stra.length);
                }
            }
            //如果数字的string不全等，但值相等
            else if (numa == numb) {
                //直接比较数字前缀0的个数，多的更小
                return strb.lastIndexOf(numb + '') - stra.lastIndexOf(numa + '');
            }
            else {
                //如果数字不等，直接比较数字大小
                return numa - numb;
            }
        }
    }
}
function fcopy(obj) {
    try {
        let json = JSON.parse(fetch('https://api.aliyundrive.com/adrive/v2/batch', {
            headers: {
                'User-Agent': PC_UA,
                'Referer': 'https://www.aliyundrive.com/',
                'authorization': obj.authorization,
                'x-canary': 'client=web,app=share,version=v2.3.1',
                'x-share-token': obj.sharetoken
            },
            body: {
                "requests": [{
                    "body": {
                        "file_id": obj.file_id,
                        "share_id": obj.share_id,
                        "auto_rename": true,
                        "to_parent_file_id": obj.folder_id || "root",
                        "to_drive_id": obj.drive_id
                    },
                    "headers": { "Content-Type": "application/json" }, "id": "0", "method": "POST", "url": "/file/copy"
                }],
                "resource": "file"
            },
            method: 'POST'
        })).responses[0].body;
        if (/size/.test(json.message)) {
            log('云盘没有空间，无法操作转存');
        }
        return json.file_id;
    } catch (e) {
        log("原画copy转存异常>" + e.message);
        return "";
    }
}

